function generateKode(length) {
    var result = "";
    var characters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
    var charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
        result += characters.charAt(
            Math.floor(Math.random() * charactersLength)
        );
    }
    return result;
}

// CONVERT NUMBER TO ROMAWI
function romanize(num) {
    var lookup = {
            M: 1000,
            CM: 900,
            D: 500,
            CD: 400,
            C: 100,
            XC: 90,
            L: 50,
            XL: 40,
            X: 10,
            IX: 9,
            V: 5,
            IV: 4,
            I: 1,
        },
        roman = "",
        i;
    for (i in lookup) {
        while (num >= lookup[i]) {
            roman += i;
            num -= lookup[i];
        }
    }
    return roman;
}

// UPPER CASE or LOWER CASE to Capitalized
function capitalize(val) {
    return val[0].toUpperCase() + val.slice(1).toLowerCase();
}

// Format Tanggal Senin, 18 Oktober 1997
function day(val) {
    let options = {
        weekday: "long",
        year: "numeric",
        month: "long",
        day: "numeric",
    };
    let thisDay = new Date(val);

    return thisDay.toLocaleDateString("id", options);
}

// Format Tanggal 18 Oktober 1997
function date(val) {
    let options = { year: "numeric", month: "long", day: "numeric" };
    let thisDay = new Date(val);

    return thisDay.toLocaleDateString("id", options);
}

